import React from "react"
import { BrowserRouter as Router, Route, Link } from 'react-router-dom'
import { Nav, NavItem, NavLink, Navbar, NavbarBrand, Button } from 'reactstrap'
import NewApartment from "./pages/NewApartment"
import AllApartments from "./pages/AllApartments"



class App extends React.Component {
  render () {
    const {
      logged_in,
      sign_in_route,
      sign_out_route
    } = this.props

    return (
      <Router>
      <Navbar color="light" light expand="md">
        <NavbarBrand href="/">Apartments For Rent</NavbarBrand>
          <Nav className="nav-bar">

          {logged_in &&
            <NavItem>
              <NavLink to="/" tag={ Link }>See All Postings</NavLink>
            </NavItem>
          } 
          {logged_in &&
            <NavItem>
              <NavLink to="/newapartment" tag={ Link }>Post a New Apartment</NavLink>
            </NavItem>
          }
          {!logged_in &&
            <NavItem>
              <Button href={sign_in_route} tag={ Link } color="primary">Sign In</Button>{' '}
            </NavItem>
          }
          {logged_in &&
            <NavItem>
              <Button href={sign_out_route} tag={ Link } color="primary">Sign Out</Button>{' '}
            </NavItem>
          }
          </Nav>
        </Navbar>
        <Route path="/newapartment/" exact component={ NewApartment }/>
        <Route path="/" exact component={ AllApartments }/> 
      </Router>
    );
  }
}

export default App
